import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import {work} from '../components/work';
import {spacer1, spacer2, spacer3, spacer4} from '../components/constants';

const workList= work.map(tile=>(
    <Col style={{marginTop: spacer3}}>
        <a href="#">
        <img src={require(`../images/workImages/${tile.imgLink}.png`)} alt={tile.company} />
        </a>
        <h3 style={{marginTop: spacer2}}> {tile.position} </h3>
        <h2 style={{marginTop: spacer1}}> {tile.company} </h2>
    </Col>
));

class Home extends React.Component{
    render(){
        return(
            <div>
                <Container>
                    <Row style={{height: "50vw"}}>
                        <Col md={8}>
                            <h1>
                                I'm Paridhi Khaitan
                            </h1>
                            <h1> 
                                I develop websites and mobile 
                                apps. I also enjoy design!  
                            </h1>
                        </Col>
                    </Row>
                    <Row>
                        {workList}
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Home;
